import React,{useState} from 'react';
import "../Button.css";
import Commencer from '../Commencer';
import '../../App.css';
import Com from '../Com';


export default function Home() {
  const [openCom,setOpencom] =useState(false);
  const classes = useStyles();


  return (<>
  <div className="home">
    <></>

      <div className="commencer">
        <p>Apprendre en<br></br>s'amusant</p><br></br>
        <button onClick={() => { setOpencom(true);}} className="btn">Commencer</button>
        </div>
      </div>    
        <Commencer title="Qui es-tu ?" className={classes.titre} setOpencom={openCom} setOpencom={setOpencom}>
            <Com/>
        </Commencer>
      </>

  );
}
